function Food({fav}) {
  console.log({fav});
  return (
    <h1>I like {fav}</h1>
  )
}

function App() {
  return (
    <div> 
      <Food fav = "kimchi" />
      <Food fav = "rice" />
      <Food fav = "meat" />
      <Food fav = "cake" />
      <Food fav = "coke" />
    </div>
  );
}

export default App;
